// jsx => vnode
// createElement 生成vnode
// vnode 是一个对象 包含 type，props，children等值

function createElement(type, props, ...children) {
    delete props.__source;
    delete props.__self;

    console.log(type, props, children);
}

export default {
    createElement
}
